.board, img, textarea{
float:left;
width:128px;
height:128px;
resize: inherit;
overflow:hidden;
background-color:transparent;
user-select: none; 
z-index:9999;
border:0;
color:#343c45;
border-radius:10px;
font-family: 'Caveat', cursive;
font-weight:600;
line-height:17px;
opacity:.8;
}
textarea{
    z-index:999999;
    font-size:18px;
    margin:10px;
    width:108px;
    height:108px;
     cursor:pointer;
}
.imgclass{
    cursor:pointer;
}

.imgclass:hover{
    opacity:1;
}
.imgclass:active{
    opacity:1;
}
textarea:hover{
    color:black;
}

#originText{
    width:50%;
    height:auto;
}

.outlink{
    color:black;
    display:inline-block;
    cursor:pointer;
    height:210px;
    width:130px;
    font-family:Piazzolla;
    font-size:11px;
    letter-spacing: 2px;
    text-align:center;
    margin:0 10px;
    padding: 0 20px;
    transition: all .1s ease-in-out;
    border-radius:10px;
    border:0px white solid;
}   
a{
    text-decoration: none;
}
.outlink img{
  text-align:center;
  display:inline;
}
.outlink p{
    display:inline-block;
    color:black;
    transition: all .1s ease-in-out;
}
.outlink:hover{
    box-shadow:0 10px 60px 0 rgba(1,1,1,.1);
}
.outlink:hover p{
    opacity:.5;
    margin-top:5px;
}

#quitter:hover, .quitterclass:hover{
    box-shadow:inset 0 0 5px 0 rgba(1,1,1,.4);
    background-color:#4287f5;
}

#quitter, .quitterclass{
    margin:10px;
    transition: all .1s ease-in-out;
    position:absolute;z-index:99999999999;
height:50px; width:50px; right:0;
background-image:url('https://static.thenounproject.com/png/1890872-200.png');
background-size:30%; background-repeat:no-repeat; background-position:center;
background-color:#e0e0d5;
border-radius: 0  0  0  10px;
box-shadow:0 0 15px 5px rgba(1,1,1,.1);
cursor:pointer;
opacity:1;

}

#door{
    z-index:9999999;
text-align:center;
display:inline-block;
font-family:Piazzolla;
letter-spacing:30px;
margin-top:30vh;
font-size:100px;
font-weight: 100;
transition: all .3s ease-in-out;
color:#616161;
cursor:pointer;
}
#door:hover, #door:hover b, #door:hover i{
  color:black; 
}


#door:hover{
    letter-spacing:60px;
}
b, i{
    color:#616161;
    font-family:Georgia;
}

